<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        body {
            background-color: black;
            color: white;
            font-family: 'Arial', sans-serif;
            font-weight: 700;
            font-size: 36px;
        }

        img {
            background-color: #fff;
        }

        #container {
            display: none;
            justify-content: flex-start;
            align-items: flex-start;
            margin-top: 20px;
            position: relative;
        }

        .person-container {
            text-align: center;
            overflow: hidden;
            margin-right: 10px;
        }

        #bon-retour {
            margin-top: 30px;
            margin-bottom: 30px;
            text-align: center;
            display: none;
        }

        .caption {
            font-size: 26px;
            color: #ccc;
            font-style: italic;
        }

        img {
            width: auto;
            height: 400px;
            object-fit: cover;
            margin-bottom: 6px;
            margin-top: 10px;
            width: 100%;
        }

        p {
            margin: 0;
        }

        button {
            background-color: white;
            color: black;
            padding: 10px;
            font-size: 16px;
            cursor: pointer;
        }

        #spinner {
            margin: 50px 150px;
            border: 16px solid #f3f3f3;
            border-top: 16px solid #3498db;
            border-radius: 50%;
            width: 120px;
            height: 120px;
            animation: spin 2s linear infinite;
        }

        @keyframes spin {
            0% { transform: rotate(0deg); }
            100% { transform: rotate(360deg); }
        }
    </style>
    <title>Random Person Generator</title>
</head>
<body>
    <div>
        <div id="spinner"></div>
        <div id="container">
            <div class="person-container" id="person1">
                <p id="deathYear1"></p>
                <img id="image1" alt="Person 1">
                <p class="caption" id="name1"></p>
            </div>
            <div class="person-container" id="person2">
                <p id="birthYear2"></p>
                <img id="image2" alt="Person 2">
                <p class="caption" id="name2"></p>
            </div>
        </div>
        <div id="bon-retour">
            <p id="bon-retour-text">Bon retour parmi nous ❤️</p>
        </div>
    </div>
    <button onclick="generate()">GÉNÉRER</button>

    <script>
        function generate() {
            const minPopularity = 50;

            document.getElementById('spinner').style.display = 'block';
            document.getElementById('container').style.display = 'none';
            document.getElementById('bon-retour').style.display = 'none';
            let loaded1 = false;
            let loaded2 = false;

            const year = randomIntFromInterval(1970, 2023);

            let person1human = false;
            let person2human = false;
            
            /* Force at least one to be human
            if (Math.random() < 0.5) {
                person1human = true;
            } else {
                person2human = true;
            }*/
            
            let filteredDead = [];
            let filteredBorn = [];

            filteredDead = peopleList.filter(person => (person[2] === year && person[3] >= minPopularity));
            filteredBorn = peopleList.filter(person => (person[1] === year && person[3] >= minPopularity));

            if (person1human) {
                filteredDead = filteredDead.filter(person => person[4] === true);
            }

            if (person2human) {
                filteredBorn = filteredBorn.filter(person => person[4] === true);
            }
            
            const deadIndex = Math.floor(Math.random() * filteredDead.length);
            const bornIndex = Math.floor(Math.random() * filteredBorn.length);

            // Get the selected people
            const person1 = filteredDead[deadIndex];
            const person2 = filteredBorn[bornIndex];

            // Display the information
            document.getElementById('image1').src = person1[6];
            document.getElementById('image2').src = person2[6];

            document.getElementById('bon-retour-text').textContent = 'Bon retour parmi nous ' + person1[0].replace(' ', '\u00a0') + '\u00a0❤️';
            image1 = document.getElementById('image1');
            image2 = document.getElementById('image2');

            image1.onload = function() {
                console.log('1 loaded');
                document.getElementById('deathYear1').textContent = `Mort(e) en ${person1[2]}`;
                const width1 = clamp(Math.floor((400 / image1.naturalHeight * image1.naturalWidth)), 300, 600);
                document.getElementById('person1').style.width = `${width1}px`;
                document.getElementById('name1').textContent = person1[0];
                loaded1 = true;
                if (loaded1 && loaded2) {
                    document.getElementById('spinner').style.display = 'none';
                    document.getElementById('container').style.display = 'flex';
                    document.getElementById('bon-retour').style.display = 'block';
                    document.getElementById('bon-retour').style.width = `${image1.width + image2.width}px`;
                }
            };
            
            image2.onload = function() {
                console.log('2 loaded');
                document.getElementById('birthYear2').textContent = `Né(e) en ${person2[1]}`;
                const width2 = clamp(Math.floor((400 / image2.naturalHeight * image2.naturalWidth)), 300, 600);
                document.getElementById('person2').style.width = `${width2}px`;
                document.getElementById('name2').textContent = person2[0];
                loaded2 = true;
                if (loaded1 && loaded2) {
                    document.getElementById('spinner').style.display = 'none';
                    document.getElementById('container').style.display = 'flex';
                    document.getElementById('bon-retour').style.display = 'block';
                    document.getElementById('bon-retour').style.width = `${image1.width + image2.width}px`;
                }
            };
        }

        function randomIntFromInterval(min, max) { // min and max included 
            return Math.floor(Math.random() * (max - min + 1) + min)
        }

        function clamp(value, min, max) {
            return Math.min(Math.max(value, min), max);
        }
